import React from 'react'
import styled from 'styled-components'
import sculture1 from '../images/sculture1.jpeg'
import sculture2 from '../images/sculture2.png'
import sculture3 from '../images/sculture3.jpeg'

function Painting() {
    return (
        <Paintingg>
            <PaingtingCtn>
                <div className="text">
                    <h1><span>P</span> ainting</h1>
                </div>
                <div className="column">
                    <div>
                        <img src={sculture1} alt="" srcset="" />
                    </div>
                    <div>
                        <img src={sculture2} alt="" srcset="" />
                    </div>
                    <div>
                        <img src={sculture3} alt="" srcset="" />
                    </div>
                </div>
            </PaingtingCtn>
        </Paintingg>
    )
}

export default Painting

const Paintingg = styled.div`
height: 100vh;
width: 100%;

display: flex;
flex-direction: column;
justify-content: center;
align-items: center;
`

const PaingtingCtn = styled.div`
height: 100vh;
width: 80%;


.text {
    width: 100%;
    display: flex;
justify-content: right;
align-items: center;
font-size: 40px;
span {
   color: #DAA520;
    font-size: 100px;
}
}

.column {
    display: flex;

    img {
        width: 20%;
        margin-right: 30px;
    }
}

`
